import React, { useState } from 'react';
import MenuIcon from '@mui/icons-material/Menu';
import PersonIcon from '@mui/icons-material/Person';
import DrawerMenu from '../components/DrawerMenu';
import './TeamPage.css';

function TeamPage() {
  const [drawerOpen, setDrawerOpen] = useState(false);
  const [openMenus, setOpenMenus] = useState({});

  // ÏòàÏãú ÌåÄÏõê Îç∞Ïù¥ÌÑ∞
  const teamMembers = [
    { id: 1, name : 'Ïù¥Î™ÖÏ§Ä', mainRole : 'PM', subRole : 'ÌîÑÎ°†Ìä∏ÏóîÎìú Í∞úÎ∞ú', keywords : ['Ï∞ΩÏùòÎ†•', 'Ïã§ÌñâÎ†•'], rating : 4.8, participation: 2 },
    { id: 2, name : 'ÌôçÏàòÏïÑ', mainRole : 'Î∞±ÏóîÎìú Í∞úÎ∞ú', subRole : 'ÏÑúÎ≤Ñ Íµ¨Ï∂ï', keywords : ['Í≥µÍ∞êÎ†•', 'Í∏∞ÌöçÎ†•'], rating : 4.3, participation: 3 },
    { id: 3, name : 'ÏûÑÏàòÏ†ï', mainRole : 'ÌÖåÏä§Ìä∏ Î∞è QA', subRole : 'DB Î∞è API Í¥ÄÎ¶¨', keywords : ['ÏπúÏ†àÌï®', 'Ïó¥Ï†ï'], rating : 3.9, participation: 1 },
    { id: 23, name : 'Ïã†Ïú†Ï∞¨', mainRole : 'ÌîÑÎ°†Ìä∏ÏóîÎìú Íµ¨ÌòÑ', subRole : 'ÏΩòÌÖêÏ∏† Ìé∏Ïßë', keywords : ['ÏûêÍ∏∞Ï£ºÎèÑÏÑ±', 'ÎÖºÎ¶¨Î†•'], rating : 2.8, participation: 1 },

  ];

 
  return (
    <div className="team-page-container">
      {/* ÏÉÅÎã® Ìó§Îçî */}
      <header className="team-page-header">
        <span className="logo">TUP!</span>
        <button className="menu-button" onClick={() => setDrawerOpen(true)}>
          <MenuIcon style={{ fontSize: '2.2rem', color: '#FF6B35' }} />
        </button>
      </header>

      <DrawerMenu
        open={drawerOpen}
        onClose={() => setDrawerOpen(false)}
        openMenus={openMenus}
        onToggle={setOpenMenus}
      />

      <div className="teampage-main">
        <h1>ü§ù ÎÇòÏùò <span className="highlight">ÌåÄ ÌîÑÎ°úÏ†ùÌä∏</span> Í≥µÍ∞Ñ</h1>
        <p>ÏßÑÌñâ Ï§ëÏù∏ ÌåÄ ÌîÑÎ°úÏ†ùÌä∏ Ï†ïÎ≥¥Î•º ÌïúÎààÏóê ÌôïÏù∏ÌïòÍ≥† ÌåÄÏõêÎì§Í≥º ÌòëÏóÖÌï¥Î≥¥ÏÑ∏Ïöî</p>
        </div>

      <div className="team-page-content">
        
        {/* ÌåÄÏõê Î™©Î°ù */}
        <section className="team-section">
          <h2>üë§ ÌåÄÏõê ÏÜåÍ∞ú</h2>
          <ul className="member-list">
            {teamMembers.map(member => (
              <li key={member.id} className="member-card">
                <strong>{member.name}</strong>
                <p>Ìù¨Îßù Ïó≠Ìï†Íµ∞ : {member.mainRole}</p>
                <p>Î≥¥Ï°∞ Í∞ÄÎä• Ïó≠Ìï†Íµ∞ : {member.subRole}</p>
                <p>ÌÇ§ÏõåÎìú : {member.keywords.join(', ')}</p>
                <p>Ï∞∏Ïó¨ Ïù¥Î†• : {member.participation}Ìöå</p>
                <p><strong>ÌèâÏ†ê :</strong> ‚≠ê {member.rating}</p>
              </li>
            ))}
          </ul>
        </section>

        {/* ÌîÑÎ°úÏ†ùÌä∏ ÏùºÏ†ï */}
        <section className="team-section">
          <h2>üóìÔ∏è ÏùºÏ†ï Í¥ÄÎ¶¨</h2>
          <p>Í≥µÏú† Ï∫òÎ¶∞Îçî Í∏∞Îä•Ïù¥ Ïù¥Í≥≥Ïóê Íµ¨ÌòÑÎê† ÏòàÏ†ïÏûÖÎãàÎã§.</p>
        </section>

        {/* ÌåÄ Í≤åÏãúÌåê */}
        <section className="team-section">
          <h2>üìî ÌåÄ Í≤åÏãúÌåê</h2>
          <p>ÏóÖÎ¨¥, Í≥µÏßÄÏÇ¨Ìï≠, ÌöåÏùòÎ°ùÏùÑ Í≥µÏú†ÌïòÎäî Í≥µÍ∞ÑÏûÖÎãàÎã§. (Ï§ÄÎπÑ Ï§ë)</p>
        </section>

        {/* Ï±ÑÌåÖÏ∞Ω */}
        <section className="team-section">
          <h2>üí¨ ÌåÄ Ï±ÑÌåÖ</h2>
          <p>Ïã§ÏãúÍ∞Ñ Ïª§ÎÆ§ÎãàÏºÄÏù¥ÏÖò Ï±ÑÌåÖ Í∏∞Îä•Ïù¥ Ï∂îÍ∞ÄÎê† ÏòàÏ†ïÏûÖÎãàÎã§.</p>
        </section>
      </div>
    </div>
  );
}

export default TeamPage;
